    "\"\"\"\n",
    "The data processing work is done in 5 major steps\n",
    "\n",
    "1.find missing data from external source\n",
    "2. imputing value to the database (excel file) directly\n",
    "\n",
    "This is since we believe that using descriptive statistics to replace \n",
    "missing values does not make sense as there are too many factors \n",
    "that affects that particular statistics\n",
    "\n",
    "If there is still data we could not find, we will use descriptive statistics \n",
    "to fill it in or not include it in the statistical analysis\n",
    "\n",
    "3. exploring data with descriptive statistics\n",
    "4. data-plotting \n",
    "5. doing correlation-based hypothesis testing \n",
    "\"\"\"\n",
    "\n",
    "\n",
    "#import packages needed\n",
